                deleteBtn.className = 'btn-delete';
                deleteBtn.textContent = '\u5220\u9664';

                // \u9632\u8BEF\u89E6\uFF1A\u8BB0\u5F55\u89E6\u6478\u8D77\u59CB\u4F4D\u7F6E
